description:
Junji Ito is most known for his graphical horror novels Tomie and Uzumaki. The style of drawing is very realistic, so much so you sometimes wish it wasn't. Also, the realistic style of drawing will appeal even to those not into manga. The type of horror you will see in his comics range from the absurd, the mind games and sometimes disgusting. However you will always be left feeling disturbed and ill at ease, sometimes without not knowing why.

